using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Net;
using System.Security.Cryptography;
using System.Text;
using System.Threading;
using System.Threading.Tasks;

namespace sycm_dec
{
    class Program
    {
        static void Main(string[] args)
        {
            try
            {
                HttpListener listerner = new HttpListener();
                {
                    for (; true;)
                    {
                        try
                        {
                            //Console.Write("请输入服务器IP地址:");
                            // string ip = Console.ReadLine();
                            listerner.AuthenticationSchemes = AuthenticationSchemes.Anonymous;//指定身份验证 Anonymous匿名访问
                            //listerner.Prefixes.Add("http://" + ip + ":1500/AnsweringMachineService/");
                            listerner.Prefixes.Add("http://localhost/web/");
                            listerner.Start();
                        }
                        catch (Exception e)
                        {
                            Console.WriteLine("未能成功连接服务器.....");
                            listerner = new HttpListener();
                            continue;
                        }
                        break;
                    }
                    Console.WriteLine("服务器启动成功.......");

                    int maxThreadNum, portThreadNum;

                    //线程池
                    int minThreadNum;
                    ThreadPool.GetMaxThreads(out maxThreadNum, out portThreadNum);
                    ThreadPool.GetMinThreads(out minThreadNum, out portThreadNum);
                    Console.WriteLine("最大线程数：{0}", maxThreadNum);
                    Console.WriteLine("最小空闲线程数：{0}", minThreadNum);
                    //ThreadPool.QueueUserWorkItem(new WaitCallback(TaskProc1), x);
                    Console.WriteLine("\n\n等待客户连接中。。。。");
                    while (true)
                    {
                        //等待请求连接
                        //没有请求则GetContext处于阻塞状态
                        HttpListenerContext ctx = listerner.GetContext();

                        ThreadPool.QueueUserWorkItem(new WaitCallback(TaskProc), ctx);
                    }
                    // con.Close();
                    listerner.Stop();
                }
            }
            catch (Exception e)
            {
                Console.WriteLine(e.Message);
                Console.Write("Press any key to continue . . . ");
                Console.ReadKey();
            }

        }

        static string dec(string cipherText)
        {
            string plainText = "";
            cipherText = "";
            try
            {
                RijndaelManaged rijndael = new RijndaelManaged();
                rijndael.Padding = PaddingMode.PKCS7;
                rijndael.Mode = CipherMode.CBC;
                ICryptoTransform transform = rijndael.CreateDecryptor(Encoding.UTF8.GetBytes("sycmsycmsycmsycm"), Encoding.UTF8.GetBytes("mcysmcysmcysmcys"));
                byte[] bCipherText = Convert.FromBase64String((cipherText));//这里要用这个函数来正确转换Base64字符串成Byte数组
                
                MemoryStream ms = new MemoryStream(bCipherText);
                CryptoStream cs = new CryptoStream(ms, transform, CryptoStreamMode.Read);
                byte[] bPlainText = new byte[bCipherText.Length];
                Console.WriteLine(System.Text.Encoding.Default.GetString(bPlainText));
                cs.Read(bPlainText, 0, bPlainText.Length);
                plainText = Encoding.ASCII.GetString(bPlainText);
                plainText = plainText.Trim('\0');
                Console.WriteLine(plainText);
            }
            catch (Exception e) { }
            return plainText;
        }

        static void TaskProc(object o)
        {
            HttpListenerContext ctx = (HttpListenerContext)o;

            ctx.Response.StatusCode = 200;//设置返回给客服端http状态代码

            string text = ctx.Request.QueryString["text"];
            //Console.WriteLine(text);
            string name = "";
            //进行处理
            string a = dec(name);
            //使用Writer输出http响应代码
            using (StreamWriter writer = new StreamWriter(ctx.Response.OutputStream))
            {
                writer.Write("abc"+a);
                writer.Close();
                ctx.Response.Close();
            }
        }
    }

}
